import React from 'react';

export default function Addusers() {
  return (
    <div className='container'>
        <div className='row'>
            <div className='col-md-6 offset-md-3 border rounded p-4 m-2 shadow'>
                <h2 className='text-center'></h2>
            </div>
        </div>
      
    </div>
  );
}
